# The "whatever it works" string slicing solution -------------------------------------------------

class Solution:
    def generateParenthesis(self, n: int) -> List[str]:
        if n == 1:
            return ['()']
        res = set()
        for s in self.generateParenthesis(n - 1):
            section = []
            for i in range(len(s)):
                for j in range(i, len(s)):
                    section.append(s[:i] + '(' + s[i:j] + ')' + s[j:])
            res.update(section)
        return res
    
